import './App.css';
import Navbar from './components/Navbar';
import Home from './components/Home';
import About from './components/About';
import Services from './components/Services';
import Contact from './components/Contact';
import Footer from './components/Footer';
import {BrowserRouter as Router, Route, Link, Routes} from 'react-router-dom';
import Login from './components/Login';
import Register from './components/Register';
import Logout from './components/Logout';
import Dashboard from './components/Dashboard';
import ProtectedRoute from './ProtectedRoute';

function App() {
  return (
    <>
    <Navbar/>
    <Routes>
    <Route exact path="/" element={<Home />} />
      <Route exact path="/about" element={<About />} />
      <Route exact path="/services" element={<Services />} />
      <Route exact path="/contact" element={<Contact />} />
      <ProtectedRoute exact path="/login" element={<Login />} auth={true} />
      <ProtectedRoute exact path="/register" element={<Register />} auth={true} />
      <ProtectedRoute exact path="/logout" element={<Logout />} auth={true} />
      <ProtectedRoute exact path="/dashboard" element={<Dashboard />} auth={true} />
      </Routes>
    <Footer/>
    </>
  );
}

export default App;
